import React from "react";
import styled from "styled-components";
import spotifyLogo from "./spotifyIcon.png";
import appleIcon from "./appleIconWhite.svg";

const Card = styled.div`
  position: relative;
  height: 20vh;
  width: 90vw;
  background-color: #009688;
  margin: 20px auto;
  padding-top:1px;
  border-radius: 6px;
  filter: drop-shadow(5px 5px 5px black);
`;
const Chapter = styled.h3`
  color: white;
  width:98%;
  margin:5px auto;
  text-align:center;
  font-weight:100;
  border-radius: 6px;
  background-color: black;
`;
const LogoContainer =styled.div`
  position: absolute;
  width:60%;
  right:20%;
  top: 30%;
  text-align:center;
  padding-top:10px;
`
const LogoWrapper = styled.div`
  margin-right:5px;
  display:inline-block;
  background-color:#f44336;
  border-radius:6px;
`;
const Logo = styled.img`
  height: 25px;
  margin: 6px;
  vertical-align:middle;
`;
export default function OldPlaylistCard(props) {
  return (
    <Card>
      <Chapter>
        {props.Chapter}: {props.Name}
      </Chapter>
      <LogoContainer>
      <LogoWrapper>
        <Logo src={appleIcon} alt="apple-logo" />
      </LogoWrapper>
      <LogoWrapper spotify>
        <Logo src={spotifyLogo} alt="spotify-logo" />
      </LogoWrapper>
      </LogoContainer>
    </Card>
  );
}
